import React from 'react';
import Button from 'react-bootstrap/Button';

class LiftConsoleButton extends React.Component {
    submit_request(to_floor, from_floor)
    {
        console.log("ERROR");
        fetch('http://localhost:8000/api/lift/request/', {
        method: 'POST',
        headers: {
            'Accept': 'application/json',
            'Content-Type': 'application/json',
        },
        body: JSON.stringify({
            from_floor: from_floor,
            to_floor: to_floor,
        })
        });
    }

    render() {
      return (<div data-testid="LiftConsoleButton"><Button variant="primary" onClick={() => this.submit_request(this.props.index, this.props.floor)}>{this.props.index}</Button></div>)
    }
}

export default LiftConsoleButton;
